import React from 'react'
import { Link } from 'react-router-dom';
import { useCart } from "react-use-cart";

function Navbar() {
  const { totalItems } = useCart()
  return (
    <div>
         <nav>  
        <div className="logo">
            <img src="img/logo.png.webp" alt=""/>
        </div>
      <div className="links">
        <ul className="list-unstyled">
            <li><Link to="/home">home</Link> </li>
            <li><Link to="/about">about</Link></li>
            <li><Link to="/programs">programs </Link> </li>
            <li><Link to="/product">products</Link></li>
            <li><Link to="/shopping">shopping</Link></li>
            <li><Link to="/contact">contact</Link></li>
            <i class="fa-solid fa-cart-arrow-down" style={{position:'relative',left:'300px'}}></i><span style={{ position: "relative", bottom: "10px", }}>{totalItems}</span>
        </ul>
        {/* <div className="p fs-5">
             <p><span>call us: </span>0 (78) 675 3674 | <i className="fa-brands fb fa-square-facebook"></i> <i className="fa-brands tw fa-square-twitter"></i> <i className="fa-brands in fa-linkedin"></i> <i className="fa-brands tube fa-youtube"></i> <i className="fa-solid envolve fa-envelope"></i> </p>
             
        </div> */}
      </div>
    </nav> 

    </div>
  )
}

export default Navbar;
